long_desc.thetext:
The representation of missing approvals in the Gerrit data model has changed in a recent version of Gerrit. This causes requirements not to be displayed correctly in the Review editor when Gerrit 2.4 or later are used (I didn't verify with 2.3 so this problem could also affect older versions).

Gerrit now uses a submitRecords field in ChangeDetail which is missing from the Mylyn data model, e.g. for https://git.eclipse.org/r/#/c/2609/:

pre. 
   "submitRecords": [
      {
        "status": "NOT_READY",
        "labels": [
          {
            "label": "Verified",
            "status": "OK",
            "appliedBy": {
              "id": 442
            }
          },
          {
            "label": "Code-Review",
            "status": "NEED"
          },
          {
            "label": "IP-Clean",
            "status": "NEED"
          }
        ]
      }
    ],
